
DROP TABLE IF EXISTS DevData;
CREATE TABLE DevData (
	ID BIGINT NOT NULL,
	app VARCHAR(50),
	site VARCHAR(50),
	device VARCHAR(50),
	mrn VARCHAR(50),
	name VARCHAR(50),
	timeReceived TIMESTAMP,
	mshDateTime VARCHAR(50),
	obsDateTime VARCHAR(50),
	hl7Id VARCHAR(50),
	hl7Source VARCHAR(50),
	hl7String VARCHAR(4096)
);

DROP TABLE IF EXISTS  iceberg_job;
CREATE TABLE iceberg_job (
	id INTEGER PRIMARY KEY AUTOINCREMENT,
	start_time DATETIME,
	end_time DATETIME,
	job_name VARCHAR,
	action_name VARCHAR,
	tablename VARCHAR,
	catalog_name VARCHAR,
	src_min_id BIGINT,
	src_max_id BIGINT,
	src_row_count BIGINT,
	src_timestamp DATETIME,
	job_status VARCHAR,
	error_message VARCHAR
);

DROP TABLE IF EXISTS iceberg_job_step;

CREATE TABLE iceberg_job_step (
	id INTEGER PRIMARY KEY AUTOINCREMENT,
	job_id INTEGER,
	start_time DATETIME,
	end_time DATETIME,
	src_min_id BIGINT,
	src_max_id BIGINT,
	src_timestamp DATETIME
);


DROP TABLE IF EXISTS log_entries;

CREATE TABLE log_entries (
	id INTEGER,
	job_id INTEGER,
	log_time DATETIME,
	"level" VARCHAR,
	message VARCHAR,
	module VARCHAR,
	function_name VARCHAR,
	line INTEGER
);



